      var hour = minute * 60;
      var day = hour * 24;

      /*   */
      var splitDate = value.split('-');
      /*   */
      var start = new Date(splitDate[0] + "-01-01");
      start = start.getTime();
      /*   */
      var date = new Date(value);
      date = date.getTime();
      /*  -  +  =   */
      /*    . */
      var days = date - start + (splitDate[0] - 2017) * day;
      /*   (7)   */
      var week = Math.ceil(days / (day * 7)) + 1;
      /*   */
      var setTime = splitDate[0] + "-" + week;

      return setTime;
